import React, { useState } from 'react';
import TechnicalAnalyzeComp from './technicalAnalyzeComp';
import Tabs from "@mui/material/Tabs";
import Tab from '@mui/material/Tab';
import Button from '@mui/material/Button';

function AnalysisComp(props) {
    const [type, setType] = useState(0)

    const handleChange = (event, newValue) => {
        setType(newValue);
    };

    return (
        <>
            <div className = 'col-md-5'>
                <div className = 'card py-4 px-4'>
                    <Tabs value = { type } onChange = { handleChange } variant = "scrollable" scrollButtons = "auto">
                        <Tab label = "基本面"></Tab>
                        <Tab label = "技術面"></Tab>
                    </Tabs>

                    <div className = 'card-body'>
                        { type === 0 && <div>基本面</div> }
                        { type === 1 && <TechnicalAnalyzeComp /> }
                    </div>
                </div>
            </div>

            <div className = 'col-md-1 text-center align-middle'>
                <div className = 'row mx-auto'>
                    <Button variant = "outlined" size = "small">
                        &gt;
                    </Button>
                </div>
            </div>

            <div className = 'col-md-5'>
                <div className = 'card'>
                    123
                </div>
            </div>
        </>
    );
}

export default AnalysisComp;
